import React from "react";
import Button from '@material-ui/core/Button';
import Avatar from '@material-ui/core/Avatar';

import CssBaseline from '@material-ui/core/CssBaseline';
import TextField from '@material-ui/core/TextField';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Checkbox from '@material-ui/core/Checkbox';
import Link from '@material-ui/core/Link';
import Grid from '@material-ui/core/Grid';
import Box from '@material-ui/core/Box';
import LockOutlinedIcon from '@material-ui/icons/LockOutlined';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';


class Signup extends React.Component{
 state = {
     email:'',
     password:'',
     firstName:'',
     lastName:'',
    }
    handleChange = (e)=>{
        this.setState({
            [e.target.id]:e.target.value
        })
    }

    handleSubmit=(e)=>{
        e.preventDefault();
        console.log(this.state)
    }
    
    render(){
        return(     
            <div className='App-container'style={{backgroundColor:'#121212'}}>
                <form onSubmit={this.handleSubmit} >
                    <h5 className='gray-text text-draken-3'> </h5>
                    <div className='input-field'>
                        <label htmlFor='email'>Email</label>
                        <input type='email' id='email'  required  onChange={this.handleChange}/>
                    </div>
                    <div className='input-field'>
                        <label htmlFor='password'>password</label>
                        <input type='password' id='password' required data-length="10" onChange={this.handleChange}/>
                    </div>
                    <div className='input-field'>
                        <label htmlFor='firstName'>firstName</label>
                        <input type='text' id='firstName' required onChange={this.handleChange}/>
                    </div>
                    <div className='input-field'>
                        <label htmlFor='lastName'>lastName</label>
                        <input type='text' id='lastName' required onChange={this.handleChange}/>
                    </div>
                    
                    <div className='input-field'>
                        <Button className="btn pink lighten-1 z-dephtn-0">Sign up</Button>
                    </div>
                    <Grid item xs={12}>
              <FormControlLabel
                control={<Checkbox value="allowExtraEmails" color="white" />}
                label="I want to receive inspiration, marketing promotions and updates via email."
              />
            </Grid>
                </form>
            </div>         
        )
    }
}

export default Signup
